import React from 'react';
import '../node_modules/font-awesome/css/font-awesome.css'

const LeaderBoard = () => {
    return (
        <>
        <i className="fa fa-file-text"></i>
        </>
    )
};
const Rewards = () => {
    return (
        <>
        <i className="fa fa fa-trophy"></i>
        </>
    )
};

export {LeaderBoard,Rewards} ;
